    <script>
    // // duyt tt c tm nh cn lazy-load
    var lazyImages = document.querySelectorAll('[lazy]');

    // khi tm nh gn chm viewport (cn 100px na l chm), th load tm nh ngay
    var threshold = 20;

    // trnh vn  v performance
    var timeout;

    function lazyload () {
    clearTimeout(timeout);

    timeout = setTimeout(function() {
        var scrollTop = window.pageYOffset;
        lazyImages.forEach(function(lazyImage) {
        var src = lazyImage.dataset.src;

        // khi v tr tm nh gn chm viewport, load ngay
        if (lazyImage.offsetTop < (window.innerHeight + scrollTop + threshold)) {
            lazyImage.tagName.toLowerCase() === 'img'
            // <img>: copy data-src sang src
            ? lazyImage.src = src

            // <div>: copy data-src sang background-image
            : lazyImage.style.backgroundImage = "url(\'" + src + "\')";

            // copy xong ri th b attribute lazy i
            lazyImage.removeAttribute('lazy');
        }
        });

        // tt c tm nh  c load xong, dn dp v i thi.
        if (lazyImages.length == 0) { 
        document.removeEventListener('scroll', lazyload);
        }
    }, 10);
    }

    document.addEventListener('scroll', lazyload);
    </script>
